import React, { Component } from 'react';

class Contact extends Component {
  constructor(props) {
    super(props);

    // Initialize state to hold form input values
    this.state = {
      name: '',
      email: '',
      phone: '',
      service: 'Please chooses',
      typeProduct: 'physical',
      fromValue: 1500,
      toValue: 3900,
      message: '',
    };
  }

  // Handle form input changes
  handleInputChange = (e) => {
    const { name, value } = e.target;
    this.setState({ [name]: value });
  };

  // Handle form submission
  handleSubmit = (e) => {
    e.preventDefault();
    // You can access the form data in this.state and perform actions like sending it to a server
    console.log('Form data:', this.state);
    // Reset the form if needed
    this.setState({
      name: '',
      email: '',
      phone: '',
      service: 'Please chooses',
      typeProduct: 'physical',
      fromValue: 1500,
      toValue: 3900,
      message: '',
    });
  };

  render() {
    return (
      <div className="container-contact100">
        <div className="wrap-contact100">
          <form className="contact100-form validate-form" onSubmit={this.handleSubmit}>
            <span className="contact100-form-title">Contact Us</span>

            {/* FULL NAME */}
            <div className="wrap-input100 validate-input bg1" data-validate="Please Type Your Name">
              <span className="label-input100">FULL NAME *</span>
              <input
                className="input100"
                type="text"
                name="name"
                placeholder="Enter Your Name"
                value={this.state.name}
                onChange={this.handleInputChange}
                required
              />
            </div>

            {/* Email */}
            <div className="wrap-input100 validate-input bg1 rs1-wrap-input100" data-validate="Enter Your Email (e@a.x)">
              <span className="label-input100">Email *</span>
              <input
                className="input100"
                type="text"
                name="email"
                placeholder="Enter Your Email"
                value={this.state.email}
                onChange={this.handleInputChange}
                required
              />
            </div>

            {/* Phone */}
            <div className="wrap-input100 bg1 rs1-wrap-input100">
              <span className="label-input100">Phone</span>
              <input
                className="input100"
                type="text"
                name="phone"
                placeholder="Enter Number Phone"
                value={this.state.phone}
                onChange={this.handleInputChange}
              />
            </div>

            {/* Needed Services */}
            <div className="wrap-input100 input100-select bg1">
              <span className="label-input100">Needed Services *</span>
              <div>
                <select
                  className="js-select2 select2-hidden-accessible"
                  name="service"
                  tabIndex="-1"
                  aria-hidden="true"
                  value={this.state.service}
                  onChange={this.handleInputChange}
                  required
                >
                  <option>Please choose</option>
                  <option>eCommerce Business</option>
                  <option>UI/UX Design</option>
                  <option>Online Services</option>
                </select>
              </div>
            </div>

            {/* What type of products do you sell? */}
            <div className="w-full dis-none js-show-service">
              <span className="label-input100">What type of products do you sell?</span>
              <div className="contact100-form-radio m-t-15">
                <input
                  className="input-radio100"
                  id="radio1"
                  type="radio"
                  name="typeProduct"
                  value="physical"
                  checked={this.state.typeProduct === 'physical'}
                  onChange={this.handleInputChange}
                />
                <label className="label-radio100" htmlFor="radio1">
                  Physical Products
                </label>
              </div>
              <div className="contact100-form-radio">
                <input
                  className="input-radio100"
                  id="radio2"
                  type="radio"
                  name="typeProduct"
                  value="digital"
                  checked={this.state.typeProduct === 'digital'}
                  onChange={this.handleInputChange}
                />
                <label className="label-radio100" htmlFor="radio2">
                  Digital Products
                </label>
              </div>
              <div className="contact100-form-radio">
                <input
                  className="input-radio100"
                  id="radio3"
                  type="radio"
                  name="typeProduct"
                  value="service"
                  checked={this.state.typeProduct === 'service'}
                  onChange={this.handleInputChange}
                />
                <label className="label-radio100" htmlFor="radio3">
                  Services Consulting
                </label>
              </div>
            </div>

            {/* Budget */}
            <div className="wrap-contact100-form-range">
              <span className="label-input100">Budget *</span>
              <div className="contact100-form-range-value">
                ${this.state.fromValue} - ${this.state.toValue}
              </div>
              <input type="text" name="fromValue" value={this.state.fromValue} readOnly />
              <input type="text" name="toValue" value={this.state.toValue} readOnly />
            </div>

            {/* Message */}
            <div className="wrap-input100 validate-input bg0 rs1-alert-validate" data-validate="Please Type Your Message">
              <span className="label-input100">Message</span>
              <textarea
                className="input100"
                name="message"
                placeholder="Your message here..."
                value={this.state.message}
                onChange={this.handleInputChange}
                required
              ></textarea>
            </div>

            {/* Submit button */}
            <div className="container-contact100-form-btn">
              <button className="contact100-form-btn" type="submit">
                <span>
                  Submit <i className="fa fa-long-arrow-right m-l-7" aria-hidden="true"></i>
                </span>
              </button>
            </div>
          </form>
        </div>
      </div>
    );
  }
}

export default Contact;
